import React from 'react'
import {ProjectsContainer} from './ProjectsElements';
import {Row, Col,Progress} from 'reactstrap';
import {Card, CardImg, CardText, CardBody,CardTitle, CardSubtitle, Button
  } from 'reactstrap';
  import img from '../images/portfolio.PNG'

const Projects = () => {
    return (
        <ProjectsContainer>
            <Col sm={{size:4, offset:2}}>
            <Card>
                <CardImg top width="20%" src={img} />
                <CardBody>
                <CardTitle tag="h5">포토폴리오 사이트</CardTitle>
                <CardSubtitle tag="h6" className="mb-2 text-muted">#React #Styled-Components #React-strap</CardSubtitle>
                <CardText>React를 이용하여 만든 포토폴리오 사이트입니다. CSS를 사용하는 대신 자바스크립트 안에 스타일을 선언하는 'CSS-in-JS' 방식을 택하여 만들었습니다. </CardText>
                <Button>Button</Button>
                </CardBody>
            </Card>
            </Col>
        </ProjectsContainer>
    )
}

export default Projects;
